import React from "react";
import { Link } from "react-router-dom";

const NavItem = ({ title, path }) => {
  return (
    <li className="nav-item">
      <Link className="nav-link" to={`${path}`}>
        {title}
      </Link>
    </li>
  );
};

export default NavItem;
